Харківська область: оперативна інформація станом на 08:00

Протягом доби співробітники ДСНС 44 рази виїжджали за сигналом «Тривога». З них виїздів 25 на ліквідацію пожеж та загорянь (19 у місті та 6 у області), 10 раз рятувальники виїздили для надання допомоги населенню, 10– інші виїзди.

Крім того піротехнічні підрозділи ДСНС проводили розмінувальні роботи: було знешкоджено 69 вибухонебезпечних предметів.

За добу було ліквідовано 24 пожежі, спричинених ворожими обстрілами.

