Голова Харківської військової адміністрації Олег Синєгубов вранці 28 лютого:

▪️ Всю ніч відбивали  наступ, знищували колони вже на підходах до позицій ще до того, як вони змогли завдати артилерійських обстрілів міста;
▪️ Місто під контролем;
▪️ Велика кількість диверсійних груп;
▪️ Вчора вся техніка була знищена, понад 20 диверсантів були заблоковані у школі, їх знищено;
▪️ Був випадок, коли одному українському військовому здалися семеро російських військових;
▪️ Люди добровільно надають автівки нашим військовим;
▪️ Розгортатимуть кілька логістичних центрів, щоб розподіляти продукти;
▪️ Є ризики наступу диверсійних груп;
▪️ Є загиблі серед дітей;
▪️ Сьогодні комендантська година буде з 15:00 до 6:00;
▪️ Мітка не означає, що в будинок прилетить снаряд, люди активно знімають мітки.

Япония, Австралия, Канада ввели санкции против России из-за признания «Л/ДНР»

❌ запрет на экспорт из так называемых «Л/ДНР»;
❌ заморозка активов официальных лиц;
❌ запрет на выпуск новых облигаций в Японии;
❌ выдача виз представителям «Л/ДНР».
❌ 8 россиян, которым будет запрещен въезд в Австралию и запрещены любые финансовые операции, связанные с австралийскими структурами и организациями;
❌ один госбанк и банки, связанные с оборонной и военной промышленностью.

Канада так же введёт санкции по членам парламента проголосовавших за признание республик.

Санкции будут действовать до тех пор, пока не будет восстановлена территориальная целостность Украины.

Так называемы лидеры республик обратились к Путину признать ЛНР и ДНР

Прямо сейчас Путин проводит внеочередное заседание Совбеза своим выступлением:

Он назвал переворот на Украине антиконституционным и кровавым и заявил, что часть жителей его не приняла.

-  Россия изначально делала всё, чтобы мирным путем решить противоречия в Донбассе;

- Киевские власти дважды провели карательные операции на Донбассе, сейчас обострение происходит в третий раз;

- Киевские власти не собираются исполнять Минские соглашения, они публично многократно об этом заявляли;

- Цель сегодняшнего заседания Совбеза - определить шаги по Донбассу, имея в виду и обращение ДНР и ЛНР с просьбой признать их суверенитет;

- Вопросы признания ДНР и ЛНР тесно связаны с глобальными проблемами обеспечения безопасности в мире и в Европе в частности.

